Grade level: 3 Key to Finding the Context

Paragraph: The _______ firefighter ran into the burning building. He saved the little kitten from the fire. The smoke _______ his eyes as he carried the kitten to safety.

Question: [
    {
        "question_1": "What word best fits in the first blank?",
        "answer_choices_1": {
            "A": "quick",
            "B": "brave",
            "C": "tall"
        },
        "teacher_solution_1": {
            "correct_answer": "B",
            "explanation": "Choice B (brave) is correct because running into a burning building requires courage, which is what 'brave' means. Choice A (quick) describes speed, not courage. Choice C (tall) describes physical height, which is not relevant to the firefighter's actions."
        },
        "question_2": "What word best fits in the second blank?",
        "answer_choices_2": {
            "A": "upset",
            "B": "moved",
            "C": "played"
        },
        "teacher_solution_2": {
            "correct_answer": "A",
            "explanation": "Choice A (upset) is correct because smoke irritates eyes, making them uncomfortable or disturbed. Choice B (moved) suggests physical movement, which doesn't make sense with eyes. Choice C (played) suggests fun activity, which is inappropriate in this context."
        }
    }
]


